import React from "react";
import './style.css';

function Icon(props){
    if(props.icon === 'search')
        return(
            <i class="fas fa-search"></i>
        )
    if(props.icon === 'bookshelf')
        return(
            <i class="fas fa-book"></i>
        )
    return(
        <i class="fas fa-angry"></i>
    )
}

export default Icon;
